import %metadata:NodeDefn:NodeURI:*;

class NodeURI
   /* Constructor */
   method NodeURI(&oNodeProperty As %metadata:NodeDefn:MsgNodeURI);

   /* properties */
   property string URIType get set;
   property string URIText get set;

private

   /* Private vars */
   instance %metadata:NodeDefn:MsgNodeURI &m_NodeURI;

end-class;

method NodeURI
   /+ &oNodeProperty as %Metadata:NodeDefn:MsgNodeURI +/
   &m_NodeURI = &oNodeProperty;
end-method;

get URIType
   /+ Returns String +/
   Return &m_NodeURI.URIType;
end-get;

set URIType
   /+ &NewValue as String +/
   &m_NodeURI.URIType = &NewValue;
end-set;

get URIText
   /+ Returns String +/
   Return &m_NodeURI.URIText;
end-get;

set URIText
   /+ &NewValue as String +/
   &m_NodeURI.URIText = &NewValue;
end-set;

import PS_PT:Integration:IRequestHandler;
import RENAME_NODE_PKG:PurgeIBMessages;
import RENAME_NODE_PKG:RenameNode;
import RENAME_NODE_PKG:ModifyNodeClass;

class IBHandler implements PS_PT:Integration:IRequestHandler
   method OnRequest(&MSG As Message) Returns Message;
   method OnError(&MSG As Message) Returns string;
end-class;

method OnRequest
   /+ &MSG as Message +/
   /+ Returns Message +/
   /+ Extends/implements PS_PT:Integration:IRequestHandler.OnRequest +/
   Local Message &requestMsg = CreateMessage(Operation.RENAME_NODE_OP_POST, %IntBroker_Request);
   Local Document &requestDoc = &MSG.GetDocument();
   Local boolean &ret = &requestDoc.ParseJsonString(&MSG.GetContentString());
   Local Compound &request = &requestDoc.DocumentElement;
   Local Message &responseMsg = CreateMessage(Operation.RENAME_NODE_OP_POST, %IntBroker_Response);
   Local Document &responseDoc = &responseMsg.GetDocument();
   Local Compound &response = &responseDoc.DocumentElement;

   /*
INPUT JSON example:

{"RENAME_NODE_REQ": {
"old_node_name": "old","new_node_name": "new","node_password": "","portal_uri": "","content_uri": "","purge_messages": false}
}
*/

   Local boolean &shouldPurgeMessages = &request.GetPropertyByName("purge_messages").value;
   Local string &oldNodeName = &request.GetPropertyByName("old_node_name").value;
   Local string &newNodeName = &request.GetPropertyByName("new_node_name").value;
   Local string &newNodePassword = &request.GetPropertyByName("node_password").value;
   Local string &portalURI = &request.GetPropertyByName("portal_uri").value;
   Local string &contentURI = &request.GetPropertyByName("content_uri").value;

   If &oldNodeName = "" Then
      throw CreateException(0, 0, "old_node_name is a required field");
   End-If;

   If &newNodeName = "" Then
      throw CreateException(0, 0, "new_node_name is a required field");
   End-If;

   If &shouldPurgeMessages Then
      Local RENAME_NODE_PKG:PurgeIBMessages &purgeClass = create RENAME_NODE_PKG:PurgeIBMessages();
      &purgeClass.purgeMessages();
   End-If;

   Local RENAME_NODE_PKG:ModifyNodeClass &modifyClass = create RENAME_NODE_PKG:ModifyNodeClass(&oldNodeName);
   If &newNodePassword <> "" Then
      &modifyClass.updatePassword(&newNodePassword);
   End-If;

   If &portalURI <> "" Then
      &modifyClass.updatePortalURI(&portalURI);
   End-If;

   If &contentURI <> "" Then
      &modifyClass.updateContentURI(&contentURI);
   End-If;
   &modifyClass.saveChanges();

   Local RENAME_NODE_PKG:RenameNode &renameClass = create RENAME_NODE_PKG:RenameNode();
   &renameClass.RenameNodes(&oldNodeName, &newNodeName);

   &response.GetPropertyByName("success").value = True;
   &response.GetPropertyByName("error_message").value = "";

   /*
Output JSON example:

{
    "RENAME_NODE_RSP": {
        "success": true,
        "error_message": ""
    }
}
*/

   Return &responseMsg;
end-method;

method OnError
   /+ &MSG as Message +/
   /+ Returns String +/
   /+ Extends/implements PS_PT:Integration:IRequestHandler.OnError +/

   Local Message &responseMsg = CreateMessage(Operation.RENAME_NODE_OP_POST, %IntBroker_Fault);
   Local Document &responseDoc = &responseMsg.GetDocument();
   Local Compound &response = &responseDoc.DocumentElement;
   &response.GetPropertyByName("success").value = False;
   &response.GetPropertyByName("error_message").value = &MSG.IBException.DefaultText;

   Return &responseDoc.GenJsonString();
end-method;

/*
CI approach to modifying a node
Does not work as of PeopleTools 8.59 because rowinit calls %request which dooes not exist in a CI.
Use ModifyNodeClass instead
*/
class ModifyNode
   method ModifyNode(&nodeName As string);

   method updatePassword(&newPassword As string);
   method updateContentURI(&newContentURI As string);
   method updatePortalURI(&newPortalURI As string);

   method saveChanges();

private
   instance ApiObject &ci;
   instance string &node;
   method handleCIErrors(&baseMessage As string);
end-class;

method ModifyNode
   /+ &nodeName as String +/
   &ci = %Session.GetCompIntfc(CompIntfc.NODE_DEFINITION_CI);
   If &ci = Null Then
      throw CreateException(0, 0, "The user does not have permissions for NODE_DEFINITION_CI");
   End-If;

   &ci.MSGNODENAME = &nodeName;

   &ci.EditHistoryItems = False;
   &ci.GetHistoryItems = False;
   &ci.GetDummyRows = False;
   &ci.InteractiveMode = True;

   If Not &ci.Get() Then
      %This.handleCIErrors("Node '" | &nodeName | "' does not exist");
   End-If;

   %This.node = &nodeName;
end-method;

method updatePassword
   /+ &newPassword as String +/
   &ci.NEW_PASSWORD = &newPassword;
   &ci.CONFIRM_NEW_PASSWORD = &newPassword;
end-method;

method updateContentURI
   /+ &newContentURI as String +/
   &ci.CONTENT_URI = &newContentURI;
end-method;

method updatePortalURI
   /+ &newPortalURI as String +/
   &ci.PORTAL_URI = &newPortalURI;
end-method;

method saveChanges
   If Not &ci.save() Then
      %This.handleCIErrors("Unable to save updates to node '" | %This.node | "'");
   End-If;
end-method;

method handleCIErrors
   /+ &baseMessage as String +/
   Local ApiObject &messages;
   Local number &i;
   Local string &errors;

   &messages = %Session.PSMessages;
   For &i = 1 To &messages.Count
      &errors = &errors | &messages.Item(&i).Text;
   End-For;
   &messages.DeleteAll();

   throw CreateException(0, 0, &baseMessage | ": " | &errors);
end-method;

import PT_IB_NODE:NodeDefinition;
import PT_IB_NODE:NodeURI;

class ModifyNodeClass
   method ModifyNodeClass(&nodeName As string);

   method updatePassword(&newPassword As string);
   method updateContentURI(&newContentURI As string);
   method updatePortalURI(&newPortalURI As string);

   method saveChanges();
private
   instance PT_IB_NODE:NodeDefinition &nodeDefinition;
   instance string &node;
   method removeNodeURIType(&type As string);
end-class;

method ModifyNodeClass
   /+ &nodeName as String +/
   &nodeDefinition = create PT_IB_NODE:NodeDefinition(&nodeName);
   If &nodeDefinition.IsNew Then
      throw CreateException(0, 0, "Node '" | &nodeName | "' does not exist.");
   End-If;
   %This.node = &nodeName;
end-method;

method updatePassword
   /+ &newPassword as String +/
   &nodeDefinition.IbPassword = &newPassword;
end-method;

method updateContentURI
   /+ &newContentURI as String +/
   %This.removeNodeURIType("CN");
   Local PT_IB_NODE:NodeURI &MsgNodeCNUri = &nodeDefinition.AddNodeURI("CN", &newContentURI);
end-method;

method updatePortalURI
   /+ &newPortalURI as String +/
   %This.removeNodeURIType("PL");
   Local PT_IB_NODE:NodeURI &MsgNodePLUri = &nodeDefinition.AddNodeURI("PL", &newPortalURI);
end-method;

method saveChanges
   Local boolean &ret = &nodeDefinition.Save();
   If Not &ret Then
      throw CreateException(0, 0, "Cannot update node " | %This.node);
   End-If;
end-method;

method removeNodeURIType
   /+ &type as String +/
   Local integer &i;
   For &i = 1 To &nodeDefinition.GetNodeURICount()
      Local PT_IB_NODE:NodeURI &uri = &nodeDefinition.GetNodeURI(&i);
      If &uri.URIType = &type Then
         Local boolean &ret = &nodeDefinition.DeleteNodeURI(&i);
         If Not &ret Then
            throw CreateException(0, 0, "Cannot remove node URI type " | &type);
         End-If;
         Break;
      End-If;
   End-For;
end-method;

