class RenameNode
   method RenameNodes(&oldNodeName As string, &newNodeName As string);
private
   method handleCIErrors(&baseMessage As string);
end-class;

method RenameNodes
   /+ &oldNodeName as String, +/
   /+ &newNodeName as String +/

   Local ApiObject &ci;

   &ci = %Session.GetCompIntfc(CompIntfc.RENAME_NODE_CI);
   If &ci = Null Then
      throw CreateException(0, 0, "The user does not have permissions for RENAME_NODE_CI");
   End-If;

   &ci.OLD_NODE_NAME = &oldNodeName;

   &ci.EditHistoryItems = False;
   &ci.GetHistoryItems = False;
   &ci.GetDummyRows = True;
   &ci.InteractiveMode = True;

   If Not &ci.Get() Then
      %This.handleCIErrors("Old node name '" | &oldNodeName | "' does not exist");
   End-If;

   &ci.NEW_NODE_NAME = &newNodeName;

   If Not &ci.save() Then
      %This.handleCIErrors("Unable to rename node '" | &oldNodeName | "' to '" | &newNodeName | "'");
   End-If;
end-method;

method handleCIErrors
   /+ &baseMessage as String +/
   Local ApiObject &messages;
   Local number &i;
   Local string &errors;

   &messages = %Session.PSMessages;
   For &i = 1 To &messages.Count
      &errors = &errors | &messages.Item(&i).Text;
   End-For;
   &messages.DeleteAll();

   throw CreateException(0, 0, &baseMessage | ": " | &errors);
end-method;
